import{_ as e,c as a,o,a4 as r,a7 as s,a8 as i,a9 as t,aa as n,ab as c,ac as d,ad as p,ae as l,af as u,ag as m,ah as h,ai as g,aj as q,ak as _}from"./chunks/framework.trjoITED.js";const D=JSON.parse('{"title":"Erros e resoluções","description":"","frontmatter":{},"headers":[],"relativePath":"pages/error_resolucoes.md","filePath":"pages/error_resolucoes.md"}'),b={name:"pages/error_resolucoes.md"},v=r('<h1 id="erros-e-resolucoes" tabindex="-1">Erros e resoluções <a class="header-anchor" href="#erros-e-resolucoes" aria-label="Permalink to &quot;Erros e resoluções&quot;">​</a></h1><p>Aqui trataremos os principais erros do clonechat.</p><h2 id="blank-id" tabindex="-1">Blank id <a class="header-anchor" href="#blank-id" aria-label="Permalink to &quot;Blank id&quot;">​</a></h2><p><img src="'+s+'" alt="Blank id error image"></p><p>Ele ocorre por conta de mensagens que foram apagadas desse canal, pois o clone chat analisa todas as mensagem do canal e quando ele encontra alguma que foi apagada ele retorna o blank id, fique tranquilo pois isso não atrapalha o funcionamento.</p><h2 id="chat-forwards-restricted" tabindex="-1">CHAT_FORWARDS_RESTRICTED <a class="header-anchor" href="#chat-forwards-restricted" aria-label="Permalink to &quot;CHAT_FORWARDS_RESTRICTED&quot;">​</a></h2><p><img src="'+i+'" alt="404 CHAT_FORWARDS_RESTRICTED image"></p><p>Esse erro ocorre pois o canal que você esta tentando clonar possui a restrição de salvamento de arquivos, para resolver é simples basta executar o arquivo <code>clonechat_protect_run.py</code> ou <code>exec_clonechat_protect.bat</code> (caso esteja no Windows) e refazer o processo de colocar os id dos canais de origem e destino.</p><h2 id="chat-id-invalid" tabindex="-1">CHAT ID INVALID <a class="header-anchor" href="#chat-id-invalid" aria-label="Permalink to &quot;CHAT ID INVALID&quot;">​</a></h2><p><img src="'+t+'" alt="404 CHAT_CHAT_ID_INVALID image"></p><p>Esse erro indica que o ID do canal está inválido, Revise o id e caso tenha dúvidas em relação a id de canais, consulte <a href="/guiaclonechat/pages/perguntas_frequentes#como-pegar-o-chat-id-de-um-grupo-canal">Guia chat id</a></p><h2 id="media-caption-too-long" tabindex="-1">MEDIA_CAPTION_TOO_LONG <a class="header-anchor" href="#media-caption-too-long" aria-label="Permalink to &quot;MEDIA_CAPTION_TOO_LONG&quot;">​</a></h2><p><img src="'+n+'" alt="MEDIA_CAPTION_TOO_LONG image"></p><p>Ele ocorre por conta que o Telegram possui diferentes limites para o plano free e o plano pago (premium). Para resolver esse erro basta excluir o <code>clonechat.py</code> e instalar essa versão que &quot;pula&quot; os arquivos que tiverem descrição maior.</p><p><a href="https://github.com/wandrey7/guiaclonechat/blob/main/docs/public/clonechat.py" target="_blank" rel="noreferrer">Clique aqui para baixar</a></p><div class="danger custom-block"><p class="custom-block-title">⚠ Atenção</p><p>Caso opte por usar a versão modificada os arquivos que for &quot;pulado&quot; não será clonado. Caso queira clonar esses arquivos, terá que adquerir o Telegram Premium!</p></div><h2 id="modulenotfounderror" tabindex="-1">ModuleNotFoundError <a class="header-anchor" href="#modulenotfounderror" aria-label="Permalink to &quot;ModuleNotFoundError&quot;">​</a></h2><p><img src="'+c+'" alt="ModuleNotFoundError image"></p><p>Bom, esse erro acontece quando não é achado o arquivo na pasta, na imagem acima vemos que o erro vem seguindo de &quot;Setup&quot; ou seja, o arquivo &quot;setup&quot; não está na pasta ou o programa não reconheceu e deu esse erro, pra resolver é bem simples, basta baixar o arquivo novamente e apagar o antigo.</p><h2 id="socket-send-raised-exception" tabindex="-1">Socket.send() raised exception <a class="header-anchor" href="#socket-send-raised-exception" aria-label="Permalink to &quot;Socket.send() raised exception&quot;">​</a></h2><p><img src="'+d+'" alt="socket send image"></p><p>Esse erro se dá por conta da conexão do seu dispositivo com a o pyrogram ou por conta da internet fraca, em muita vezes e só esperar ou reiniciar o programa que ele volta normalmente, em caso de sua internet estar fraca não tem muito o que fazer.</p><h2 id="messages-gethistory-modo-bot" tabindex="-1">Messages.GetHistory (modo bot) <a class="header-anchor" href="#messages-gethistory-modo-bot" aria-label="Permalink to &quot;Messages.GetHistory (modo bot)&quot;">​</a></h2><p><img src="'+p+'" alt="GetHistory image"></p><p>Erro se dá por conta dos bots do Telegram não ter acesso ao histórico antigo do grupo/canal,o bot só vai ter acesso às mensagens que foram enviadas depois que ele entrou no grupo/canal.</p><h2 id="winerror-267-o-nome-de-diretorio-e-invalido" tabindex="-1">[WinError 267] O nome de diretório é invalido <a class="header-anchor" href="#winerror-267-o-nome-de-diretorio-e-invalido" aria-label="Permalink to &quot;[WinError 267] O nome de diretório é invalido&quot;">​</a></h2><p><img src="'+l+'" alt="Win error 267 image"></p><p>Erro que ocorre na clonagem de canal com caracteres especiais no nome.</p><blockquote><p>Ex:. Á</p></blockquote><p>A solução se aplica ao <code>Clonechat_protect</code> mas pode ser usada a mesma lógica para os demais códigos.</p><p>Edite o arquivo <code>clonechat_protect.py</code>em <code>clonechat\\protect_content\\clonechat_protect.py</code> e colocar na <code>linha número 360</code>, esse trecho.</p><div class="language-python vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">python</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">chat_origin_title </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> re.sub(</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">r</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;</span><span style="--shiki-light:#032F62;--shiki-dark:#DBEDFF;">:</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">, </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">, chat_origin_title)</span></span></code></pre></div><p>Em <code>r&quot;:&quot;</code> pode-se colocar caracteres indesejados, como no exemplo: <code>r&quot;.\\*!,&#39;|&quot;#;:?%&quot;</code>, em meus testes só consegui sucesso com &quot;:&quot;.</p><p>Os caracteres indesejados serão substituídos por nada, caso queira substituir por underscore ou espaço em branco, basta alterar o conteúdo: <code>re.sub(r&quot;:&quot;, &quot;underscore ou espaço aqui...&quot;, chat_origin_title)</code></p><div class="danger custom-block"><p class="custom-block-title">⚠ Atenção</p><p>É preciso importar a biblioteca re acrescentando &quot;import re&quot; no começo do arquivo!</p></div><h3 align="center">Resumindo em uma foto</h3><p><img src="'+u+'" alt="image"></p><p>Caso queira o arquivo clonechat_protect.py já editado e funcionado basta baixar abaixo:</p><p><a href="https://github.com/wandrey7/guiaclonechat/blob/main/docs/public/clonechat_protect.py" target="_blank" rel="noreferrer">Clique aqui para baixar</a></p><h2 id="sintaxe-do-nome-do-arquivo" tabindex="-1">Sintaxe do nome do arquivo <a class="header-anchor" href="#sintaxe-do-nome-do-arquivo" aria-label="Permalink to &quot;Sintaxe do nome do arquivo&quot;">​</a></h2><p><img src="'+m+'" alt="Win error sintaxe image"></p><p>Delete os arquivos .session e tente novamente. Esse erro é causado por conta da sessão do Telegram.</p><h2 id="tgcrypto-extension-error" tabindex="-1">Tgcrypto extension Error <a class="header-anchor" href="#tgcrypto-extension-error" aria-label="Permalink to &quot;Tgcrypto extension Error&quot;">​</a></h2><p><img src="'+h+'" alt="image"></p><p>A mensagem de erro que você está vendo indica que é necessário ter o Microsoft Visual C++ 14.0 ou uma versão mais recente instalada para compilar a extensão <code>tgcrypto</code>. Para resolver esse problema, siga estas etapas:</p><p>Instale as Ferramentas de Compilação do Microsoft Visual C++:</p><p>Você pode baixar as ferramentas de compilação necessárias no site da Microsoft Visual Studio. <a href="https://visualstudio.microsoft.com/visual-cpp-build-tools/" target="_blank" rel="noreferrer">Clique aqui</a></p><p>Faça o download e instale as Ferramentas de Compilação do Visual C++. Exemplo na imagem abaixo:</p><p><strong>Atualize ou Instale o Microsoft Visual Studio:</strong></p><p><img src="'+g+'" alt="image"></p><p>Alternativamente, você pode instalar ou atualizar o Microsoft Visual Studio, que inclui as ferramentas de compilação necessárias. Certifique-se de selecionar a opção <code>Desenvolvimento para área de trabalho com C++&quot; durante a instalação</code>.</p><h2 id="erros-de-api" tabindex="-1">Erros de api <a class="header-anchor" href="#erros-de-api" aria-label="Permalink to &quot;Erros de api&quot;">​</a></h2><ol><li>Error. Try again</li></ol><p><img src="'+q+'" alt="image"></p><p>Nesse exemplo acima temos o error.Try again que pode ter varias resoluções.</p><p>1.-Erro causado por conta de dados incorretos.</p><p>2.-erro causado por conta de internet lenta.</p><p>3.- erro causado por conta de arquivos .session passados.</p><p>Nos erros causados por dados incorretos ou por conta de arquivos .session é recomendado apagar todos os arquivos que contem .session no final, em algumas situações por conta de atualizações no Telegram esse erro é causado.</p><p>2- Erro ao criar API</p><p><img src="'+_+'" alt="image"></p><p>Esse erro é principalmente causado pelo uso de vpn/número gringo.</p><ul><li><p>Caso seu número seja Brasileiro verifique se está usando VPN ou DNS. Mesmo desativando e o erro persistir mude de navegador ou de rede. O site nao constuma aceitar VPN.</p></li><li><p>Número gringo geralmente nao dá erro pra criar conta, caso aconteca tente o processo com uma VPN de mesma origem.</p></li></ul>',63),k=[v];function f(E,x,y,C,T,A){return o(),a("div",null,k)}const I=e(b,[["render",f]]);export{D as __pageData,I as default};
